import React, { Component } from 'react';

class ShowList extends React.Component {

	  render() {
		return (
		  <div>
				{this.props.items.map(function(object, i){
					if (object.message) {
						return <div className={"row"} key={i}> 
										<b key={i}> {object.id}</b> 
									</div>; 
					}
					if (object.link) {
						return <div className={"row"} key={i}>
											<img src="{object.link}"/>
									</div>; 
					}
					})}
				</div>
		);
	  }
	}


export default ShowList;
